import React, { useState } from 'react';

function EmployeeForm() {
  const [name, setName] = useState('');
  const [id, setId] = useState('');
  const [department, setDepartment] = useState('');
  const [dob, setDob] = useState('');
  const [gender, setGender] = useState('');
  const [designation, setDesignation] = useState('');
  const [salary, setSalary] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    if (validateForm()) {
      setName('');
      setId('');
      setDepartment('');
      setDob('');
      setGender('');
      setDesignation('');
      setSalary('');
      setError('');
      alert('Employee details submitted successfully.');
    } else {
      setError('Please fill out all fields correctly.');
    }
  };

  const validateForm = () => {
    if (!name || !id || !department || !dob || !gender || !designation || !salary) {
      return false;
    }
    if (name.length > 30) {
      setError('Name should be within 30 characters.');
      return false;
    }
    if (salary.length > 8) {
      setError('Salary should be within 8 digits.');
      return false;
    }
    return true;
  };

  return (
    <div>
      <h2>Employee Form</h2>
      {error && <div style={{ color: 'red' }}>{error}</div>}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </div>
        <div>
          <label>Employee ID:</label>
          <input
            type="text"
            value={id}
            onChange={(e) => setId(e.target.value)}
          />
        </div>
        <div>
          <label>Department:</label>
          <select value={department} onChange={(e) => setDepartment(e.target.value)}>
            <option value="">Select department</option>
            {/* Add options for departments */}
          </select>
        </div>
        <div>
          <label>Date of Birth:</label>
          <input
            type="date"
            value={dob}
            onChange={(e) => setDob(e.target.value)}
          />
        </div>
        <div>
          <label>Gender:</label>
          <label><input type="radio" value="Male" checked={gender === 'Male'} onChange={() => setGender('Male')} /> Male</label>
          <label><input type="radio" value="Female" checked={gender === 'Female'} onChange={() => setGender('Female')} /> Female</label>
        </div>
        <div>
          <label>Designation:</label>
          <input
            type="text"
            value={designation}
            onChange={(e) => setDesignation(e.target.value)}
          />
        </div>
        <div>
          <label>Salary:</label>
          <input
            type="text"
            value={salary}
            onChange={(e) => setSalary(e.target.value)}
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default EmployeeForm;
